import React from 'react';
import { useForm } from 'react-hook-form';
import { BlockPicker } from 'react-color';
import { SliderPicker } from 'react-color';

// import styles from MUI
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';

import styles from '../../assets/jss/components/list/dashlistStyle.js';
import themes from '../../assets/data/themes.json';

const useStyles = makeStyles(styles);


export default function ThemeList(props) {
    const classes = useStyles();

    const { register, handleSubmit, errors } = useForm();
    const onSubmit = data => console.log(data);

    return (
        <Grid
            container
            direction="column"
            justify="center"
            alignItems="center"
        >
            <Grid
                item
                xs={8} sm={8}
            >
                <form onSubmit={handleSubmit(onSubmit)}>
                    <input type="text" placeholder="" name="Primary color" ref={register({ required: true, maxLength: 80 })} />
                    <input type="submit" />
                </form>
            </Grid>
            <Grid
                item
                xs={4} sm={4}
            >
                <SliderPicker />
                <BlockPicker 
                    triangle="hide"
                />
            </Grid>
        </Grid>
    );
}
